import React, { useEffect, useReducer } from "react";
import { Confirmed_Cases } from "../../actions/Api";
import { CircleLoading } from "react-loadingg";
import StickyHeadTable from "./sample"
import SimpleBreadcrumbs from "./breadcrumbs"

import CssBaseline from "@material-ui/core/CssBaseline";
import Container from "@material-ui/core/Container";
import { makeStyles } from "@material-ui/core/styles";

const useStyles = makeStyles(theme => ({
  root: {
    flexGrow: 1,
    marginTop: "5%"
  },
  paper: {
    padding: theme.spacing(2),
    textAlign: "center",
    color: theme.palette.text.secondary
  }
}));

function reducer(state, action) {
  switch (action.type) {
    case "load": {
      return {
        ...state,
        isloading: true
      };
    }
    case "loaded": {
      return {
        ...state,
        isloading: false,
        list: action.item
      };
    }
    default:
      break;
  }
  return state;
}
const InitialState = {
  isloading: false,
  list: []
};
export default function ConfirmedCase(props) {
  const classes = useStyles();
  const [state, dispatch] = useReducer(reducer, InitialState);
  const { list, isloading } = state;
  useEffect(() => {
    let isSubscribed = true;
    if (isSubscribed) {
      dispatch({ type: "load" });
      const Loaddata = async () => {
        await Confirmed_Cases()
          .then(res => {
            console.log(res.data);
            dispatch({
              type: "loaded",
              name: "confirmed_cases",
              item: res.data
            });
          })
          .catch(err => console.log(err));
      };
      Loaddata();
    }
    return () => {
      console.log("unmounted");
      isSubscribed = false;
    };
  }, []);

  console.log(list)
  return (
    <React.Fragment>
      {isloading ? (
        <CircleLoading />
      ) : (
        <div>
            <div style={{margin:'1%'}}>
                <SimpleBreadcrumbs {...props} />
            </div>

          <CssBaseline />
          <Container maxWidth="lg">
              <div style={{marginTop:'5%'}}>

              </div>
              <StickyHeadTable />
          </Container>
        </div>
      )}
    </React.Fragment>
  );
}
